@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vaginal_endometrial_stromal_sarcoma rdfs:subClassOf :vagina_sarcoma ;
    :has_definition "A vagina sarcoma that has_material_basis_in endometrial stroma." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vaginal_endometrial_stromal_tumor rdfs:subClassOf :vaginal_cancer ;
    :has_definition "A vaginal cancer that has_material_basis_in endometrial stroma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometrium_carcinoma_in_situ rdfs:subClassOf :endometriosis,
        :in_situ_carcinoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :endometrium ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma that is located_in the endometrium." ;
    :has_exact_synonym "carcinoma in situ of endometrium"@en,
        "endometrial carcinoma in situ"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_wilms_tumor rdfs:subClassOf :nephroblastoma ;
    :has_exact_synonym "Nonanaplastic renal Wilm's tumor"@en,
        "Nonanaplastic renal Wilm's tumour"@en,
        "renal Wilms' tumour"@en ;
    :has_related_synonym "nonanaplastic renal wilms tumor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:metachronous_kidney_wilms_tumor rdfs:subClassOf :nephroblastoma ;
    :has_related_synonym "metachronous Wilms tumor of the kidney"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_cell_type_kidney_wilms_tumor rdfs:subClassOf :nephroblastoma ;
    :has_exact_synonym "mixed cell type kidney Wilms' tumour"@en,
        "mixed cell type renal Wilms tumor"@en,
        "mixed cell type renal Wilms tumour"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scrotum_neoplasm rdfs:subClassOf :male_reproductive_organ_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :scrotum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Scrotal Ca"@en,
        "Scrotal tumor"@en,
        "malignant Scrotal neoplasm"@en,
        "malignant tumor of scrotum"@en,
        "malignant tumour of scrotum"@en,
        "neoplasm of scrotum"@en,
        "scrotum cancer"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blastema_predominant_kidney_wilms_tumor rdfs:subClassOf :nephroblastoma ;
    :has_exact_synonym "Blastema Predominant renal Wilms tumor"@en,
        "Blastema Predominant renal Wilms tumour"@en,
        "blastema predominant kidney Wilms' tumour"@en,
        "blastema predominant kidney adenosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_wilms_tumor rdfs:subClassOf :nephroblastoma ;
    :has_definition "A nephroblastoma that results_in either bilateral disease or a family history of Wilms' tumour." ;
    :has_exact_synonym "Hereditary Wilms tumor"@en,
        "Hereditary Wilms tumour"@en,
        "WT1"@en,
        "hereditary Wilms' tumour"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epithelial_predominant_wilms_tumor rdfs:subClassOf :nephroblastoma ;
    :has_exact_synonym "epithelial Predominant renal Wilms tumor"@en,
        "epithelial Predominant renal Wilms tumour"@en,
        "epithelial predominant Wilms' tumour"@en,
        "epithelial predominant kidney adenosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cervical_wilms_tumor rdfs:subClassOf :cervical_carcinosarcoma ;
    :has_definition "A cervical carcinosarcoma is located_in the cervix with morphological features resembling Wilms tumor of the kidney." ;
    :has_related_synonym "cervical Wilms tumor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stromal_predominant_kidney_wilms_tumor rdfs:subClassOf :nephroblastoma ;
    :has_exact_synonym "Stromal Predominant renal Wilms tumor"@en,
        "Stromal Predominant renal Wilms tumour"@en,
        "stromal predominant kidney Wilms' tumour"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peripheral_nervous_system_ganglioneuroblastoma rdfs:subClassOf :ganglioneuroblastoma ;
    :has_exact_synonym "PNS Ganglioneuroblastoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fallopian_tube_adenomatoid_tumor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :mesothelium ],
        [ a owl:Restriction ;
            owl:onProperty :has_origin ;
            owl:someValuesFrom :gland ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :squamous_epithelial_cell ],
        :adenoma,
        :fallopian_tube_benign_neoplasm ;
    :has_definition "A fallopian tube benign neoplasm that derives_from mesothelium." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ureteral_obstruction rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ureter ],
        :ureteral_disease,
        :urinary_tract_obstruction .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aortic_disease rdfs:subClassOf :artery_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :aorta ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An artery disease that is characterized by degeneration of the cells composing the aortic wall." ;
    :has_exact_synonym "aortic disorder"@en,
        "disorder of the aorta"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urinary_tract_obstruction rdfs:subClassOf :urinary_system_disease ;
    :has_exact_synonym "Obstructive Uropathy"@en,
        "urinary obstruction"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fructose_1_6_bisphosphatase_deficiency rdfs:subClassOf :carbohydrate_metabolic_disorder ;
    :has_definition "A carbohydrate metabolic disorder that has_material_basis_in a deficiency of fructose-1,6-bisphosphatase resulting in hypoglycemia and metabolic acidosis on fasting due to insufficient fructose bisphosphatase for gluconeogenesis." ;
    :has_exact_synonym "fructose 1 phosphate aldolase deficiency"@en,
        "fructose-1,6-diphosphatase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:monodermal_teratoma rdfs:subClassOf :ovarian_germ_cell_teratoma ;
    :has_definition "An ovarian germ cell teratoma that has_material_basis_in a tissue type from one germ cell layer (ectoderm, mesoderm or endoderm)." ;
    :has_exact_synonym "Ovarian Monodermal teratoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_struma_ovarii rdfs:subClassOf :ovarian_germ_cell_monodermal_and_highly_specialized_teratoma ;
    :has_definition "A struma ovarii that is cancerous." ;
    :has_exact_synonym "Struma ovarii, malignant"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_disorder_of_glycosylation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :carbohydrate_metabolic_disorder,
        :physical_disorder ;
    :has_definition "A carbohydrate metabolic disorder that involves deficient or defective glycosylation of a variety of tissue proteins and/or lipids." ;
    :has_exact_synonym "carbohydrate-deficient glycoprotein syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_inflammatory_demyelinating_polyradiculoneuropathy rdfs:subClassOf :autoimmune_disease_of_peripheral_nervous_system ;
    :has_definition "An autoimmune disease of peripheral nervous system that is characterized by inflammation of nerve roots and peripheral nerves and destruction of the fatty protective covering (myelin sheath) over the nerves. This affects how fast the nerve signals are transmitted and leads to loss of nerve fibers." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:demyelinating_polyneuropathy rdfs:subClassOf :polyneuropathy ;
    :has_exact_synonym "peripheral demyelinating neuropathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:von_economo_s_disease rdfs:subClassOf :encephalitis ;
    :has_exact_synonym "Encephalitis lethargica"@en,
        "von Economo disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glomangiosarcoma rdfs:subClassOf :glomus_tumor ;
    :has_exact_synonym "malignant Glomus neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:subungual_glomus_tumor rdfs:subClassOf :glomus_tumor ;
    :has_exact_synonym "subungual glomus tumour"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_hemangioblastoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :retina ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :endothelial_cell ],
        :carcinoma,
        :retinal_cancer ;
    :has_exact_synonym "Capillary hemangioma of retina" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hemangioblastoma rdfs:subClassOf :hemangioma ;
    :has_exact_synonym "Capillary Hemangioblastoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_vasculitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :central_nervous_system_disease,
        :vasculitis ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vasculitis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :central_nervous_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A vasculitis that is characterized by inflammation of blood vessel walls in the brain or spine." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:inflammatory_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma that is characterized by a prominent intristic inflammatory component." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conventional_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma that is not histologically defined as spindle cell leiomyosarcoma, epithelioid leiomyosarcoma, or myxoid leiomyosarcoma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_leiomyosarcoma rdfs:subClassOf :central_nervous_system_mesenchymal_non_meningothelial_tumor,
        :leiomyosarcoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :leiomyosarcoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :central_nervous_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A leiomyosarcoma that is located_in the central nervous system." ;
    :has_exact_synonym "leiomyosarcoma of the CNS"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:granular_cell_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma that is characterized by a proliferation of cells containing abundant granular eosinophilic cytoplasm." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colon_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma and sarcoma of colon that is located_in the colon." ;
    :has_exact_synonym "Colonic leiomyosarcoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:human_immunodeficiency_virus_infectious_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :congenital_transmission ;
                            rdf:rest [ rdf:first :contact_transmission ;
                                    rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                            rdf:rest [ rdf:first :vehicle_borne_ingestion_transmission ;
                                                    rdf:rest [ rdf:first :vehicle_borne_medical_transmission ;
                                                            rdf:rest :nil ] ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :apthous_ulcer ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :human_immunodeficiency_virus_1 ;
                            rdf:rest [ rdf:first :human_immunodeficiency_virus_2 ;
                                    rdf:rest [ rdf:first :human_immunodeficiency_virus ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results in destruction of immune system, leading to life-threatening opportunistic infections and cancers, has_material_basis_in Human immunodeficiency virus 1 or has_material_basis_in Human immunodeficiency virus 2, which are transmitted by sexual contact, transmitted by transfer of blood, semen, vaginal fluid, pre-ejaculate, or breast milk, transmitted by congenital method, and transmitted by contaminated needles. The virus infects helper T cells (CD4+ T cells) which are directly or indirectly destroyed, macrophages, and dendritic cells. The infection has symptom diarrhea, has symptom fatigue, has symptom fever, has symptom vaginal yeast infection, has symptom headache, has symptom mouth sores, has symptom muscle aches, has symptom sore throat, and has symptom swollen lymph glands." ;
    :has_exact_synonym "HIV infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colon_sarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :embryonic_cell_metazoa_ ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :colon ],
        :colon_cancer,
        :sarcoma ;
    :has_definition "A colon cancer that arises from transformed cells of mesenchymal origin and is located_in the colon." ;
    :has_exact_synonym "Colonic sarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart_leiomyosarcoma rdfs:subClassOf :heart_sarcoma ;
