    :has_exact_synonym "cardiac sarcoma"@en,
        "sarcoma of Heart"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovary_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "An ovary sarcoma that arises from smooth muscle progenitors." ;
    :has_exact_synonym "leiomyosarcoma of Ovary"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epithelioid_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma that is composed predominantly or entirely of round or polygonal cells with eosinophilic, or much less commonly, clear cytoplasm." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lung_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma and sarcoma of lung that is located_in the lung." ;
    :has_exact_synonym "pulmonary leiomyosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anus_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma and sarcoma of the anus that is located_in the anus." ;
    :has_exact_synonym "leiomyosarcoma of anus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myxoid_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma that is characterized by abundant myxoid stroma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:small_intestine_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma,
        :small_intestine_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :leiomyosarcoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :small_intestine ] ;
                            rdf:rest :nil ] ] ] ;
