@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:small_intestinal_sarcoma rdfs:subClassOf :small_intestine_cancer ;
    :has_definition "A sarcoma and malignant tumor of small intestine that is located_in the small intestine." ;
    :has_exact_synonym "sarcoma of the Small Intestine"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cutaneous_leiomyosarcoma rdfs:subClassOf :skin_sarcoma ;
    :has_exact_synonym "leiomyosarcoma of the skin"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_dermis_tumor rdfs:subClassOf :skin_cancer ;
