                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :dermis ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant dermis tumour"@en,
        "malignant neoplasm of Dermis"@en,
        "malignant tumor of dermis"@en,
        "malignant tumour of dermis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

