    :has_exact_synonym "leiomyosarcoma of the gallbladder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophagus_leiomyosarcoma rdfs:subClassOf :esophagus_sarcoma ;
    :has_exact_synonym "leiomyosarcoma of esophagus"@en,
        "leiomyosarcoma of oesophagus"@en,
        "oesophagus leiomyosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostate_leiomyosarcoma rdfs:subClassOf :prostate_sarcoma ;
    :has_definition "A prostate sarcoma that is located_in the prostate." ;
    :has_exact_synonym "leiomyosarcoma of the prostate"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

