    :has_definition "A vagina sarcoma that has_material_basis_in smooth muscle." ;
    :has_exact_synonym "leiomyosarcoma of the vagina"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_leiomyosarcoma rdfs:subClassOf :breast_sarcoma ;
    :has_definition "A breast sarcoma that arises from smooth muscle cells." ;
    :has_exact_synonym "leiomyosarcoma of the breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_leiomyosarcoma rdfs:subClassOf :vulvar_sarcoma ;
    :has_definition "A vulvar sarcoma that has_material_basis_in smooth muscle cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

