    :has_definition "A leiomyosarcoma and sarcoma of kidney that is located_in the kidney." ;
    :has_exact_synonym "leiomyosarcoma of kidney"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:larynx_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma ;
    :has_definition "A leiomyosarcoma located_in the larynx." ;
    :has_exact_synonym "leiomyosarcoma of Larynx"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

