        :lice_infestation ;
    :has_definition "A lice infestation that involves colonization of the hair and skin by the parasitic insect Pediculus humanus capitis, which feeds on blood several times daily and resides close to the scalp to maintain its body temperature. The symptoms include tickling feeling of something moving in the hair, itching, caused by an allergic reaction to louse saliva, and irritability." ;
    :has_exact_synonym "Pediculosis capitis"@en,
        "Pediculus capitis"@en,
        "Pediculus capitis infestation"@en,
        "head louse infestation"@en .

