@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:toxic_pneumonitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        :pneumonia ;
    :has_definition "A pneumonia that is an acute inflammation of the lungs induced by inhalation of metal fumes or toxic gases and vapors. It is a sentinel health event (occupational) associated with exposure to ammonia (refrigeration, fertilizer, and oil refining industries), chlorine (alkali and bleach industries), nitrogen oxides (silo fillers, arc welders, and nitric acid industry), sulfur dioxide (paper, refrigeration, and oil refining industries), cadmium (processors and cadmium smelters), trimellitic anhydride (plastics and organic chemical synthesis), and vanadium pentoxide (boilermakers). The two types of pulmonary agents are central and peripheral. Central pulmonary agents, for example, ammonia, are water soluble irritants that injure the upper airways. Peripheral pulmonary agents, for example, phosgene, NOx, and PFIB, are slightly water soluble irritants that injure the alveolar-capillary membranes. Chlorine has both central and peripheral effects." ;
    :has_exact_synonym "acute chemical fume pulmonary edema"@en,
        "acute chemical pulmonary edema"@en .

