@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kidney_osteogenic_sarcoma rdfs:subClassOf :kidney_sarcoma ;
    :has_definition "A kidney sarcoma that starts in the bones and that is located in the kidney." ;
    :has_exact_synonym "renal Osteogenic sarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

