    :has_definition "A breast fibrocystic disease that is characterized by the absence of epithelial cell hyperplasia." ;
    :has_exact_synonym "Non-Proliferative Fibrocystic Change"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microglandular_adenosis rdfs:subClassOf :breast_disease ;
    :has_definition "A breast disease that is characterized by a haphazard infiltration of small, uniformly open, and round glands which are lined by a monolayer of flat to cuboidal epithelial cells that lack a myoepithelial layer, the absence of stromal desmoplasia and the presence of a thickened basement membrane." ;
    :has_exact_synonym "Adenosis - breast"@en,
        "Adenosis of the breast"@en .

