:animal_phobia rdfs:subClassOf :specific_phobia ;
    :has_definition "A specific phobia that involves a fear caused by the presence or thought of a specific animal that poses little or no danger at all." ;
    :has_exact_synonym "Fear of animals"@en,
        "Zoophobia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

