            owl:onProperty :has_symptom ;
            owl:someValuesFrom :heart_failure ],
        :heart_disease ;
    :has_definition "A heart disease that is characterized by any structural or functional cardiac disorder that impairs the ability of the heart to fill with or pump a sufficient amount of blood throughout the body." ;
    :has_exact_synonym "CHF"@en,
        "Cardiac Failure Congestive"@en,
        "Congestive heart disease"@en,
        "Weak heart"@en .

